const dummy = [
  {
    id: 3,
    username: 'SooBin',
    title: '⚡️ 즉시 이자 받기가 가능해졌어요.',
    content:
      '그것도 위젯으로 간편하게. 하루만 넣어도 쌓이는 연 2%의 이자를 원할 때마다 받을 수 있게 되었다는 사실.',
    createdAt: '2022-02-26T16:17:47.000Z',
  },
  {
    id: 2,
    username: 'YoungWoong',
    title: '🏛 토스 주민센터가 열렸어요. ',
    content:
      '직접 주민센터에 가지 않아도, 수수료 없이 등본을 뗄 수 있는 시대가 왔어요.',
    createdAt: '2022-02-25T16:17:47.000Z',
  },
  {
    id: 1,
    username: 'MinWoo',
    title: '🧭 구석구석 숨어있던 버그들을 잡았어요.',
    content:
      '또 다른 버그가 나타나면 토스 고객센터를 찾아주세요. 늘 열려있답니다. 365일 24시간 언제든지요.',
    createdAt: '2022-02-24T16:17:47.000Z',
  },
];

export default dummy;
